import React from 'react'

export default function InputSlider({ranges , step , setPreferredLowestPrice , setPreferredHighestPrice }) {
    return (
        <div id="inputSlider">
              <input id="ppInputAscending" type="range" min={ranges.min} max={ranges.max}  step={step} />
              <input id="ppInputDescending" type="range" min={ranges.min} max={ranges.max} step={step} onChange={(e) => setPreferredHighestPrice(Number.parseInt(e.target.value))}/>
        </div>
    )
}
